window.bookSummaryJSON = "<p><b>The #1 </b><b><i>New York Times</i></b><b> bestseller</b></p> <p><b>With over 22,000,000 copies sold in 50 languages, and used in more than 176 nations, </b><b><i>Dianetics</i></b><b> brings dramatic and permanent improvement to people all over the world.</b></p> <p><b>“While it’s true that </b><b><i>Dianetics</i></b><b> has become the self-improvement classic, there can be little doubt that what it has to offer is just what people are now looking for in ever increasing numbers. Reducing stress, achieving goals, improving relationships and striving to live up to one’s full potential is definitely the </b><b><i>in</i></b><b> thing.” </b><b><i>(New York Post)</i></b></p> <p><b>“Hubbard’s bestseller has helped millions, and it should be read and used by all who are searching for a true understanding of the mind and a solution to such problems as self-doubt, stress, anxiety and depression.” </b><b><i>(World Reporter)</i></b></p> <p><b>“[Dianetics is] a new science which works with the invariability of physical science in the field of the human mind. From all indications it will prove to be as revolutionary for humanity as the first caveman’s discovery and utilization of fire.” </b><b><i>(Daily Mirror)</i></b></p> <p>If you’ve ever felt there was something holding you back in life, ruining your plans and stopping you from being who you want to be, you were right.</p> <p>The fact is, there is a single source of all your problems, stress, unhappiness and self-doubt. It’s called the <i>reactive mind</i>—the hidden part of your mind that stores all painful experiences, then uses them against you.</p> <p>With Dianetics, you can learn to control your reactive mind—freeing you to live an extraordinary life and be your true self.</p> <p>Don’t live with insecurity, negative thoughts, depression and irrational behavior. Use Dianetics to take control of your future.</p> <p>Key discoveries contained in <i>Dianetics:</i></p> <p></p> <ul> <li>Why do we give up on our dreams?</li> <li>What is the real cause of depression?</li> <li>Is there a cure for stress?</li> <li>How do you reach your full potential?</li> <li>Why do we hurt the ones we love?</li> <li>Why are some people prone to illness?</li> <li>How can you improve your mental health?</li> <li>Can you conquer your fears?</li> </ul> <p>Start the adventure—of <i>you.</i> Buy and listen to <i>Dianetics: The Modern Science of Mental Health.</i></p> <p><b>About the author: </b></p> <p>With over two hundred million copies of his works in circulation and dozens of international bestsellers, L. Ron Hubbard has inspired a movement spanning every continent on earth. All told, those works comprise some 5,000 writings and 3,000 recorded lectures and, as such, stand as the single most embracive statement on the human mind and spirit. His breakthroughs have helped millions lead more successful lives and achieve true happiness.</p>"; 
